import './App.css';
import { Body } from './components/Body'
import { Speciality } from './components/Speciality'
import { About } from './components/About'
import { Skills } from './components/Skills'
import { Contact } from './components/Contact'
import Menu from './components/Menu/Menu';
import { useState } from 'react';


function App() {
  const [menuActive, setMenuActive] = useState(false)

  const items = [{value:"Glavnya", href: "/main", icons: "logout"},{value:"Home", href: "/service", icons: "thumb_up"},{value:"Otsos", href: "/shop", icons: "task_alt"}]

  return (

    <div className="App">
        <nav>
          <div className='click'>
          <div className='Burger' onClick={()=> setMenuActive(!menuActive)}>
            <span/>
          </div>
          </div>
        </nav>
        <main>
          <Body title={''}/>
          <Speciality title={''}/>
          <About title={''}/>
          <Skills title={''}/>
          <Contact title={''}/>
          <Menu active = {menuActive} setActive={setMenuActive} header={"Burger"} items={items}/>
          </main>
    </div>
  );
}

export default App;
